import './App.css';
import MyHeader from './MyHeader';
import MyFooter from './MyFooter';

function App() {
  const test = '이게 되네!?'

  const style = {
    bgBlack : {
      backgroundColor : '#000',
    },
  }

  return (
    <div className="App">
      <MyHeader />
      <h2>React Start! {test}</h2>
      <b id='boldText'>react.js</b>
      <MyFooter/>
    </div>
  );
}

// module.exports = {}
// 밖에서 app.jsx의 경로를 통해 import 할 경우 함수명 기입
export default App;
